    [],nt"num_tags": 7,nt"name": "master-plan-for-physical-and-biological-development-of-fish-springs-national-wildlife-refu",nt"isopen":
    false,nt"url": null,nt"notes": "This document is the Master Plan for physical
    and biological development of Fish Springs National Wildlife Refuge in Juab county,
    Utah. The Fish Springs National Wildlife Refuge Master Plan guides the long-range
    development of the Refuge by identifying and integrating appropriate habitats, management
    strategies, program elements, and facilities which support the goals and objectives
    for which the Refuge was established. This plan discusses the following topics:
    physical and biological characteristics, development of impoundments and water control
    structures, water management, land use management, biological management, maintenance,
    and budget.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
